import React from 'react';
import './about.css';
import Gsap from './Gsap';
import { Col } from 'reactstrap';

const About = () => {
	return (
		<div className="about" id="about">
			<h1 className="presentation">PRESENTATION</h1>
			<div className="columns">
				<Col md="8">
					<p className="name">Bonjour ! Je suis Kenny</p>
					<p className="me">
						Développeur web fullstack autodidacte de 28 ans basé sur Avignon. Le développement web
						est une de mes passions, que je cultive durant mon temps libre. <br /> Je suis
						passionné par l'UX-UI design, les créations web et toutes les dernières technologies. J'aime
						expérimenter, créer et relever de nouveaux défis.
					</p>

				</Col>
				<Col md="4">
				<Gsap />
				</Col>
			</div>
		</div>
	);
};

export default About;
